import contact from "./style.module.css"

const Contact = () => {
    return (
        <div className={contact.root}>
            <h1>Our page in git:</h1>
            <p><a href="https://github.com/bazrik/baz_game" rel="noreferrer" target="_blank">bazrik/baz_game</a></p>
        </div>
    )
}

export default Contact;
